import React from 'react';
import User from './User';

const Users = (props) => {
    console.log()
    return(
        <div>
            {
                this.state.users.map( (user, i) => {
                    return <User 
                    name={props[i].name} 
                    username={props[i].username}
                    email={props[i].email}
                    /> 
                })
            }
        </div>
    );
}

export default Users;
